import React from 'react';

const projects = [
  {
    title: "Pico Soundpad",
    description: "This project enables PICO VR Headsets to play sound in the microphone...",
    link: "https://github.com/puskainrestpease/pico-soundpad"
  }
];

export default function Projects() {
  return (
    <section id="projects">
      <h2>My Projects</h2>
      {projects.map((project, index) => (
        <div key={index} className="project">
          <h3>{project.title}</h3>
          <p>{project.description}</p>
          <a href={project.link} target="_blank" rel="noopener noreferrer">
            View Project
          </a>
        </div>
      ))}
    </section>
  );
}
